import { Drawer } from "rsuite";
import { useForm } from "react-hook-form";

const NewCode = ({ show, toggleDrawer }) => {
  const NewCodeStyle = {
    width: "30%",
    marginLeft: "5rem",
  };
  const formStyles={
      display: "flex",
      flexFlow: "column",
      maxWidth: "5rem"
  }
  const { register, handleSubmit } = useForm();
  function onSumitHandler(data){
      console.log(data)
  }

  return (
    <>
      <Drawer
        show={show}
        onHide={toggleDrawer}
        placement="bottom"
        style={NewCodeStyle}
      >
        <Drawer.Header>Add Code</Drawer.Header>
        <Drawer.Body>
          <form onSubmit={handleSubmit(onSumitHandler)} style={formStyles}>
            <label>Code Section Name</label>
            <input type="text" placeholder="enter name" name="new_code_name" />
            <button className="primaryButton">Commit</button>
          </form>
        </Drawer.Body>
      </Drawer>
    </>
  );
};

export default NewCode;
